import { useNavigate } from "react-router-dom";
import {useState } from "react";
export default function DownloadCV(){
	const [cvdownloadcount,GetCvDownloadCount]=useState('0');
	const handelDownloadedCvCount =()=>{
		alert("I am clicked");
	}
	return (
		<div className="container-fluid cv-container-fluid">
			<div className="container download_cv_container">
			
				<div className="row">
					<div className="col-md-4 education_div"></div>
					<div className="col-md-4 download_btn_div">
					<a href="/vaibhav-gangrade-react-portfolio/images/Vaibhav_Gangrade_web_Developer.docx" className="btn btn-primary btn-lg download_cv" onClick={(e)=>handelDownloadedCvCount}>Download CV({cvdownloadcount})</a>
					<span id="no_of_downloaded_cv"></span>
					</div>
					<div className="col-md-4 education_div"></div>
				</div>
			</div>
		</div>
	)
}
